// SPDX-License-Identifier: MIT
pragma solidity 0.8.6;

import "./IBEP20.sol";
import "./Context.sol";
import "./SafeMath.sol";
import "./Ownable.sol";
import "./BaseERC.sol";
import "./Address.sol";
//token owner will be a time lock contract after farming started
contract  GFX is Context, Ownable, BaseERC {
    using SafeMath for uint256;
    using Address for address;

    struct LockedToken {
        bool isUnlocked;
        uint256 unlockedTime;
        uint256 amount;
    }
    struct  AddressMiningTxn{
        address _addr;
        uint256 _txn;
        bool isMining;
    }
    uint256 public constant MAX_SUPPLY = 100000000e18;//100M
    uint256 public constant MINING = 64000000e18;//64M TRADE NFT FOR GOT IT FULL LOCKNTIME - UNLOCK EVERY MINING
    uint256 public constant AIRDROP = 10000000e18;//10M FULL LOCKTIME - UNLOCK EVERY CLAIM
    uint256 public constant MARKETING = 5000000e18;//5M
    uint256 public constant INVESTOR = 6000000e18;//6M LOCK TIME 12 MONTH - UNCLOCK EVERY 6 MONTH WITH 33% LAST RELEASE 1%
    uint256 public constant FOUDING = 15000000e18;//15M LOCK TIME 24 MONTH - UNCLOCK EVERY 6 MONTH WITH 10%

    uint256 public initTimeInvestor;
    uint256 public initTimeFouding;

    address public tokenInvestor;
    address public tokenFouding;
    address public tokenMarketing;
    address public tokenAirdrop;
    
    uint256 public marketingUnlocked = 0;
    uint256 public totalMiningunlock = 0;
    uint256 public investorUnlocked = 0;
    uint256 public foudingUnlocked = 0;
    
    bool unlockProcessInvesting = true;
    bool unlockProcessFouding = true;
    
   constructor(address _fouding, address _investing, address _marketing, address _airdrop)  BaseERC("Gofox", "GFX") {
        initialSetup(_fouding,_investing, _marketing, _airdrop);
    }

    function initialSetup( address _fouding, address _investing, address _marketing, address _airdrop) internal {
        initTimeInvestor = block.timestamp.add(30*86400*12);//1 YEAR AT NOW FOR INVESTOR
        initTimeFouding = block.timestamp.add(30*86400*24);//2 YEAR AT NOW FOUDING
        tokenInvestor = _investing;
        tokenFouding = _fouding;
        tokenAirdrop = _airdrop;
        tokenMarketing = _marketing;


        whitelist[address(this)] = true;
        _mint(address(this), MAX_SUPPLY);//FOUDING AND INVESTOR HAD UNLOCK WITH RULES
        _transfer(address(this), tokenAirdrop, AIRDROP);//ALLOTMENT FOR AIRDROP
        _transfer(address(this), tokenMarketing, MARKETING);//ALLOTMENT FOR MARKETING
    }

    //GET AMOUNT TOKEN UNLOCK OF INVESTOR
    function releasableInvestor() public view returns (uint256) {
        require(unlockProcessInvesting==true, "Process unlock token Investor has end");
        require(initTimeInvestor > 0,"initTime of contract can not zero");
        if(block.timestamp<initTimeInvestor) return 0;
        uint256 totalReleasable = INVESTOR.mul(33).div(100);
        
        uint256 supply_remain = INVESTOR.sub(investorUnlocked);
        
        if(supply_remain<=totalReleasable){
                totalReleasable = supply_remain;
        }
        return totalReleasable;
    }

    //GET AMOUNT TOKEN UNLOCK OF FOUDING
    function releasableFouding() public view returns (uint256) {
        require(unlockProcessFouding==true, "Process unlock token Fouding has end");
        require(initTimeFouding > 0,"initTime of contract can not zero");
        if(block.timestamp<initTimeFouding) return 0;
        
        uint256 totalReleasable = FOUDING.mul(10).div(100);
        uint256 supply_remain = FOUDING.sub(foudingUnlocked);
           if(supply_remain<=totalReleasable){
                totalReleasable = supply_remain;
        }
        
        return totalReleasable;
    }

    function releasableMining() public view returns (uint256){
        return MINING.sub(totalMiningunlock);
    }
    
    //UNLOCK TOKEN FOR FOUDING
    function releaseFouding()  public {
        require(unlockProcessFouding==true, "Process unlock token Fouding has end");
        uint256 releasable = releasableFouding();
        if (releasable > 0) {
            
            uint256 supply_remain = FOUDING.sub(foudingUnlocked);
            if(supply_remain<=releasable){
                unlockProcessFouding = false;
                releasable = supply_remain;
            }
            initTimeFouding = block.timestamp.add(6 * 30 * 86400);//ADD 6 MONTH FOR NEXT RELEASE
            foudingUnlocked = foudingUnlocked.add(releasable);
            _transfer(address(this), tokenFouding, releasable);
        }
    }

    //UNLOCK TOKEN FOR INVESTOR
    function releaseInvestor() public {
        require(unlockProcessInvesting==true, "Process unlock token Investor has end");
        uint256 releasable = releasableInvestor();
        if (releasable > 0) {
            uint256 supply_remain = INVESTOR.sub(investorUnlocked);
            if(supply_remain<=releasable){
                unlockProcessInvesting = false;
                releasable = supply_remain;
            }
            
            initTimeInvestor  = block.timestamp.add(6 * 30 * 86400);//ADD 6 MONTH FOR NEXT RELEASE
            investorUnlocked = investorUnlocked.add(releasable);
            _transfer(address(this), tokenInvestor, releasable);
        }
    }
    

    uint256 public txFeePerThousand = 0;    
    function setFeePerThousand(uint256 _fee) public onlyOwner {
        require(_fee <= 10, "max fee is 1%");
        txFeePerThousand = _fee;
    }
    mapping (address => bool) public whitelist;    //reserved for token contract, masterchef, pancake pair
    mapping (address => bool) public whitelistRecipient;    //reserved for token contract, masterchef, pancake pair
    // mapping (address => bool) public accountClaimded;
    function setWhitelist(address _addr, bool _val) public onlyOwner {
        whitelist[_addr] = _val;
    }

    function setlistRecipient(address _addr, bool _val) public onlyOwner {
        whitelistRecipient[_addr] = _val;
    }

    
    function miningToken(address recipient, uint256 amount)public onlyOwner returns (bool success) {
        uint256 releasable = releasableMining();
        if(releasable<=amount) return false;//CHECK TOTAL AIRDROP AVAILABLE SUPPLY
        totalMiningunlock = totalMiningunlock.add(amount);
       _transfer(address(this), recipient, amount);
    }
    
    function shouldHaveFee(address sender, address recipient) public view returns (bool) {
        return !whitelist[sender] && !whitelistRecipient[recipient] && txFeePerThousand > 0;
    }
    
    function computeTxFee(address sender, address recipient, uint256 amount) public view returns (uint256, uint256) {
        uint256 fee = 0;
        uint256 recipientAmount = amount;
        if (!whitelist[sender] && !whitelistRecipient[recipient] && txFeePerThousand > 0) {
            fee = amount.mul(txFeePerThousand).div(1000);
            recipientAmount = amount.sub(fee);
        }
        return (fee, recipientAmount);
    }

	function _transfer(address sender, address recipient, uint256 amount) internal override {
        require(sender != address(0), "BRC20: transfer from the zero address");
        require(recipient != address(0), "BRC20: transfer to the zero address");

        _beforeTokenTransfer(sender, recipient, amount);

        _balances[sender] = _balances[sender].sub(amount, "BRC20: transfer amount exceeds balance");

        (uint256 fee, uint256 recipientAmount) = computeTxFee(sender, recipient, amount);
        
        require(fee.add(recipientAmount) == amount, "!!!! Fee calculation");

        _balances[recipient] = _balances[recipient].add(recipientAmount);
        emit Transfer(sender, recipient, recipientAmount);

	}
	
	function balance() public view returns (uint256){
	    return _balances[address(this)];
	}
	//ONLY OWNER APPROVE BURN TOKEN
	function _burnToken(uint256 amount) public onlyOwner returns(bool success){
	    _burn(address(this),amount);
	}
}
